INSERT INTO TB_INSCRICAO VALUES("136","CATEQUESE","S","2018-01-23 13:37:18","A","N","N","","7","SEBASTIANA ","61984327005","Ento, no sei o que dizer sobre mim, mas eu venho de uma famlia bem grande e barulhenta, no me leve a mal eu amo isso, mas dentro de uma casa onde eu parece ter vindo de um outro universo  meio difcil de socializar, todos sempre compartilham das mesmas opinies, gostos musicais, modo de se vestir e at mesmo apreciam as mesmas series de TV, mas acho que  bom para uma questo de equilbrio ter tantas diferenas o problema  que eu os amo demais mas  difcil tentar fazer parte quando voc  visto como uma total estranha. No fico muito em casa, trabalho a semana toda e no final de semana tem as atividades da pastoral. Sinceramente no sei mais o que falar rsrs.... Estou ingressando na Fateo para cursar teologia e sinceramente isso me deixa muito animada. Quero um dia casar e constituir uma famlia conforme Deus sonhou, com todos os filhos que ele nos confiar. Ah,  claro tenho namorado e ele me ajuda muito na questo de caminhar com os olhos fitados para o cu, alm do mais  meu melhor amigo. Enfim acho que me excedi nessas linhas mas foi o que saiu, estou ansiosa para o retiro pois j faz algum tempo que estou vivendo uma certa aridez espiritual e sei que de certa forma por mais difcil que seja isso  sinal de coisa boa vindo, afinal o amor di e sei que mesmo na dor ou na alegria no tem outro lugar  que eu prefira estar do que com Jesus.","","","162","165");
